import React from "react";

const Grid = () => {
  return (
    <div>
      <div className="row">
        <div className=" col  col-md-4  ">col-sm-3</div>
        <div className=" col  col-md-4 ">col-sm-6</div>
        <div className=" col  col-md-4 ">col-sm-3</div>
      </div>
    </div>
  );
};
export default Grid;
